import sqlite3 from 'sqlite3';

// Initialize SQLite database in memory
const db = new sqlite3.Database(':memory:', (err) => {
  if (err) {
    return console.error(err.message);
  }
  console.log('Connected to the in-memory SQLite database.');

  // Create books table
  db.run('CREATE TABLE books (id INTEGER PRIMARY KEY AUTOINCREMENT, title TEXT, author TEXT)', (err) => {
    if (err) {
      return console.log(err.message);
    }
    console.log("Table 'books' created.");

    const sampleBooks = [
      { "title": "Designin data-insernsive applications", "author": "Martin Kleppman" },
      { "title": "Structure and interpretation of computer programs", "author": "Harold Abelson" },
      { "title": "C++ programming, designing and problem solving", "author": "D.S. Malik" },
      { "title": "C++ programming, designing including data structures", "author": "D.S. Malik" },
      { "title": "If it's raining in Brazil, buy Starbucks", "author": "Peter Navarro" },
      { "title": "Modern poker theory", "author": "Michael Acevedo" },
      { "title": "Elettronica per maker", "author": "Paolo Aliverti" },
      { "title": "Designing bots", "author": "Amir Shevat" },
      { "title": "Puntatore e strutture dati dinamiche", "author": "Gianpiero Cabodi" },
      { "title": "Learning go", "author": "Bodner" },
      { "title": "Introduzione agli algoritmi e strutture dati", "author": "Thomas H. Cormen" },
      { "title": "Algoritmi in C", "author": "Robert Sedgewick" },
      { "title": "Il linguaggio C fondamenti e tecnica di programmazione", "author": "Paul J. Deitel" },
      { "title": "Corso di analisi", "author": "Luigi Cerchia" },
      { "title": "Algebra", "author": "Giulia Maria Piacentini" },
      { "title": "Algebra Lineare", "author": "W. Keith Nicholson" },
      { "title": "Principi di fisi", "author": "Fabio Bruni" },
      { "title": "Trading and Exchanges: Market Microstructure for Practitioners", "author": "Larry Harris" },
      { "title": "Eloquent Javascript", "author": "Marijn Haverbeke" }
    ];

    const insertBookQuery = 'INSERT INTO books (title, author) VALUES (?, ?)';
    sampleBooks.forEach(book => {
      db.run(insertBookQuery, [book.title, book.author], (err) => {
        if (err) {
          console.error('Error inserting sample data:', err.message);
        }
      });
    });
  });
});

export default db;
