async function runQuery() {
  const query = document.getElementById('sqlQuery').value;
  try {
    const response = await fetch('/run-query', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ query }),
    });
    const data = await response.json();
    displayQueryResults(data.results);
    fetchData();
  } catch (error) {
    fetchData();
    console.error('Error:', error);
  }
}

function displayQueryResults(results) {
  const table = document.getElementById('queryResults');
  const tbody = table.getElementsByTagName('tbody')[0];
  tbody.innerHTML = ''; // Clear previous results
  if (results.length > 0) {
    // Dynamically generate table headers based on keys of the first result
    const thead = table.getElementsByTagName('thead')[0];
    thead.innerHTML = ''; // Clear previous headers
    const headerRow = thead.insertRow();
    Object.keys(results[0]).forEach(key => {
      const th = document.createElement('th');
      th.textContent = key;
      headerRow.appendChild(th);
    });

    // Fill table rows
    results.forEach(row => {
      const tr = tbody.insertRow();
      Object.values(row).forEach(val => {
        const td = tr.insertCell();
        td.textContent = val;
      });
    });
  } else {
    // Handle no results
    const tr = tbody.insertRow();
    const td = tr.insertCell();
    td.textContent = 'No results found';
    td.colSpan = Object.keys(results[0]).length;
  }
}

  async function fetchData() {
    try {
      const response = await fetch('/books');
      const data = await response.json();
      displayData(data);
    } catch (error) {
      console.error('Error:', error);
    }
  }

  function displayData(data) {
    const readingBooksList = document.getElementById('readingBooks');
    const rows = readingBooksList.getElementsByTagName('tr');
    
    for (let i = rows.length - 1; i >= 0; i--) {
        const row = rows[i];
        const firstCell = row.cells[0];
        if (firstCell && firstCell.tagName.toLowerCase() === 'th') {
            continue; // Skip if the first cell is a th
        }
        readingBooksList.removeChild(row);
    }
    data.forEach(book => {
      const row = readingBooksList.insertRow();
      const cell1 = row.insertCell(0);
      const cell2 = row.insertCell(1);
      cell1.textContent = book.title;
      cell2.textContent = book.author;
    });


    const sideProjectsList = document.getElementById('sideProjects');
    data.projects.forEach(project => {
      const li = document.createElement('li');
      li.textContent = project.name + ':' + project.description;
      sideProjectsList.appendChild(li);
    });
  }

  fetchData();

  document.addEventListener('DOMContentLoaded', function() {
    const queryButton = document.getElementById('queryButton');
    queryButton.addEventListener('click', runQuery);
  });
